import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "./pages/login/Login"
import './App.css'


function App() {  
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<h1>Home</h1>} />
          <Route path={"/login"} element={<Login />} />
        </Routes>      
      </div>
    </BrowserRouter>
  )
}

export default App;
